def performance(player, playerID, teamID, leagueID, startDate, endDate, url, headers): 
    #technically we dont have to pass all these variables in bc of scope, but will anyway.
    params = {
    'type': 'Player Stats',
    'filter': '2', #we will assume they are in passes info
    'league': leagueID,
    'team': teamID,
    'played': 'All matches',
    'position': 'All Player Positions', #Goalkeeper',
    'agestart': '16',
    'ageend': '41',
    'noofmatch': '0',
    'seasonstart': startDate,
    'seasonend': endDate,
    'by': 'season',
    'timestart': '0',
    'timeend': '90',
    'showtype': 'total',
    }
    response = requests.request(
        method='GET',
        url=url,
        headers=headers,
        params=params,
    )
    data = response.json()
    position = data["result"][playerID]["info"]["position"]
    games = data["result"][playerID]["data"]["played"]
    mins = data["result"][playerID]["data"]["min"]
    playTimeString = "\033[93mPLAYING TIME\n----------------------------------------\033[0m\n"
    playTimeString += "[\033[91m%s\033[0m]\n" % player
    playTimeString += "Games Played: %s\nMinutes: %s" % (games, mins) 
    return (position, games, mins, playTimeString)
def goalsScored(data):
    return "Goals: %s" % (data["total"])
def shotAccuracy(data):
    return "Shots: %s\nPct Accuracy: %s\nShots on Goal: %s" % (data["total"], data["total_avg"],int(round(getShots(data["total"], data["total_avg"]))))
def passAccuracy(data):
    return "Successful Passes: %s\nKey Passes: %s\nAssists %s" % (data["pass"], data["keypass"], data["assists"])
def duelsWon(data):
    return "Committed: %s\nSuffered: %s\nTackles: %s\nTake Ons: %s" % (data["commit"], data["suffer"], data["tackle"], data["dribble"])
def defActions(data):
    return "Interceptions: %s\nBlocked Shots: %s\nClearances: %s" % (data["interception"], data["blocked"], data["clear"])
def discipline(data):
    return "Yellow Cards: %s\nRed Cards: %s" % (data["yellow"], data["red"])
def goalsConceded(data):
    return "Conceded: %s" % (data["total"])
def claims(data):
    return "Claims: %s\nFailed Claims: %s" % (data["success"], data["fail"])
def saved(data):
    return "Saves: %s" % (data["total"])
def cleanSheets(data):
    return "Clean Sheets: %s" % (data["total"])
def getShots(x,y):
    return x*y*.01
